import React from "react";
import { reducerFunction } from "../../helpers";

export const Body = function () {
  const [counter, setCounter] = React.useState(0);

  let start = new Date().getTime();
  let resultCallback = React.useCallback(() => {
    let result = compute(10);
    return result;
  }, []);
  let end = new Date().getTime();
  console.log((end - start) / 3600);

  const onBtnClick = function () {
    setCounter(counter + 1);
  };
  return (

    <div>
      <button onClick={onBtnClick}>Increment</button>
    </div>
  );
};

function compute(props) {
  let result = 0;
  for (let i = 0; i < 1000000000; i++) {
    result += i;
  }
  return result;
}
